function Contact() {

    return (
        <div>
             <div class="header-shadow" style={{ background: `url(${myProfile})`, }}>
                <h10>Hey There, <br></br> I'm Shubhangi Mundhada, <br></br> Full Stack Web Developer!</h10>
            </div>

            <About/>
        </div>



    )
}

export default Contact
